import "./Contact.css";
import { useNavigate } from "react-router";

function Contact({ contact, onDelete }) {
  const navigate = useNavigate();

  const { id, last_name, first_name, email, phone_number, house, suite, mailbox_center, mailbox_number,
    class_year, city, state, should_contact, contact_status, pte_status, registration_status, stage_of_voting_process } =
    contact;

  const arr = [id, last_name, first_name, email, phone_number, house, suite, mailbox_center, mailbox_number,
    class_year, city, state, should_contact ? "Yes" : "No", contact_status, pte_status, registration_status, stage_of_voting_process];

  return (
    <tr className="border-b odd:bg-white even:bg-gray-50 odd:dark:bg-gray-800 even:dark:bg-gray-700 dark:border-gray-600">
      {arr.map((field) => (
        // <Contact key={field} contact={contact} onDelete={deleteContact} />
        <td key={arr.indexOf(field)} className="py-4 px-6 text-sm text-gray-500 whitespace-nowrap dark:text-gray-400">{field}</td>
      ))}

      {/* <td>{contact.first_name}</td>
      <td>{contact.email}</td>
      <td>{contact.phone_number}</td>
      <td>{contact.house}</td>
      <td>{contact.suite}</td>
      <td>{contact.mailbox_center}</td>
      <td>{contact.mailbox_number}</td>
      <td>{contact.class_year}</td>
      <td>{contact.city}</td>
      <td>{contact.state}</td>
      <td>{contact.should_contact ? "Yes" : "No"}</td>
      <td>{contact.contact_status}</td>
      <td>{contact.pte_status}</td>
      <td>{contact.registration_status}</td>
      <td>{contact.stage_of_voting_process}</td> */}
      <td>
        <i
          className="fas fa-edit mr-1"
          onClick={() => {
            navigate("/edit-contact", { state: contact });
          }}
        />
        <i className="fas fa-trash mr-1" onClick={() => onDelete(contact.id)} />
      </td>
    </tr>
  );
}

export default Contact;
